import App from '../App'
import ExpenseItem from './ExpenseItem'
import './Expenses.css'

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={App.expenses[0].title}
        amount={App.expenses[0].amount}
        date={App.expenses[0].date}
      />
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
    </div>
  )
}

export default Expenses
